import React, { useEffect } from "react";
import { connect } from "react-redux";
import { getKittens, deleteKitten } from "../Redux/Reducers/ProfileSlice"; // 替换为正确的导入路径

const KittenPage = ({ kittens, loading, getKittens, deleteKitten }) => {
  useEffect(() => {
    getKittens();
  }, [getKittens]);

  const handleDelete = (kittenId) => {
    deleteKitten(kittenId);
  };

  return (
    <div>
      <h1>Kitten Page</h1>
      {loading ? (
        <p>Loading kittens...</p>
      ) : (
        <ul>
          {kittens.map((kitten) => (
            <li key={kitten._id}>
              <h3>{kitten.breed}</h3>
              <p>{kitten.alt}</p>
              {/* Add any additional kitten information you want to display */}
              <button onClick={() => handleDelete(kitten._id)}>Delete</button>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

const mapStateToProps = (state) => ({
  kittens: state.profile.kittens,
  loading: state.profile.loading,
});

const mapDispatchToProps = {
  getKittens,
  deleteKitten,
};

export default connect(mapStateToProps, mapDispatchToProps)(KittenPage);
